create database vivaio;

create table vivaio.report(
 id int,
 nome_latino varchar(100),
 nome_comune varchar(100),
 esotica boolean,
 fornitore_id int,
 partita_iva VARCHAR(11),
 codice_fiscale VARCHAR(16),
 nome VARCHAR(50),
 cognome VARCHAR(50),
 indirizzo VARCHAR(100),
 cap VARCHAR(5),
 comune VARCHAR(50),
 provincia VARCHAR(2) 
);


